INSERT INTO `missao` (`id`, `nome`, `descricao`, `assunto`, `dep`, `ano`, `link_to_apresentacao`, `num_participantes`, `p1`, `r1`, `p2`, `r2`, `p3`, `r3`, `logo`, `Keywords`) VALUES
(1, 'IAHS2014', '40.ª  edição  do  ciclo  de  conferências  da  International  Association  for  Housing  Science  (IAHS)', 'A 40.ª  edição  do  ciclo  de  conferências  da  International  Association  for  Housing  Science  (IAHS),  organizado  pelo ITeCons –  Instituto  de  Investigação  e  Desenvolvimento  Tecnológico  em  Ciências  da  Construção\n', '', 2014, 'repos/2014/IAHS2014/docs/HTML/index.htm', 2, 'Luís Matias', 'repos/2014/IAHS2014/relatorios/INF28-Rel_congressos_IAHS_LM_V3.pdf', 'Nádia Lampreia', 'repos/2014/IAHS2014/relatorios/INF29_rel_congressos_20141218_IAHS_NL_V2.pdf', '', '', '', 'IAHS,Planeamento Urbano, Design de edifícios, Materiais e Tecnologia da Construção, Sustentabilidade, eficiência energética, NRI, DED\n\n'),
(2, 'DWP', 'Reuniões com a equipa do Danube Water Program (DWP) ', 'Participação em reunião.\nTeve como objetivo fazer um balanço preliminar \nda colaboração havida e avaliar as oportunidades\n', '', 2014, '', 1, 'Helena Alegre', 'repos/2014/DWP/relatorios/I731_inf55_RelMissao_Tirana_V2[1].pdf', '', '', '', '', '', 'Danube Water Program, águas resíduais, IWA'),
(3, 'H2020 Space', 'Participação Em Encontro: Infoday Horizon 2020 Space', 'Infoday Horizon 2020 Space - Network for Call 2015 and Preparation Calls 2016—2017', '', 2015, '', 1, 'José Nuno Pedroso Lima', 'repos/2015/H2020%20Space/relatorios/Inf122_V1.pdf', '', '', '', '', '', 'Infoday, H2020, GNSS, Horizon'),
(4, 'CT 14-Madeiras', 'Participação Em Comissões Técnicas:CT 14 - Madeiras', 'Participação em reunião plenária da CT 14 no Pólo II da Faculdade de Ciências e Tecnologia/Universidade de Coimbra\n', '', 2015, '', 1, 'José Saporiti Machado', 'repos/2015/CT%2014-Madeiras/relatorios/RelatMissao_02SM_Inf122_V2.pdf', '', '', '', '', '', 'Madeiras, CT-14-Madeiras, IPQ, Normalização, DNP, DE/NCE, NCE'),
(5, 'CEN-TC104-SC1-TG11', 'Participação em reunião do grupo de trabalho do CEN/TC104/SC1/TG11', 'Foi discutida a versão preliminar do texto da norma europeia EN 13791, que se encontra em processo de revisão (cópia do documento nas pasta docs.)\n\n', '', 2015, '', 1, 'Arlindo Gonçalves', 'repos/2015/CEN-TC104-SC1-TG11/relatorios/mod585_LondresATIC_V3.pdf', '', '', '', '', '', 'CEN/TC104/SC1/TG11, EN13791, comissões, Materiais, Normas'),
(6, 'Pr50-MAP-12', 'Programa  de  Capacitação  dos  Laboratórios  de  Engenharia  dos \nPALOP – Fase V', 'Participação em Reunião - No âmbito do Programa de Capacitação dos Laboratórios de Engenharia dos PALOP e Administração Pública de Timor-Leste 201', '', 2015, '', 1, 'Ana Maria Vieira', 'repos/2015/Pr50-MAP-12/relatorios/vu_Inf_94_V4.pdf', '', '', '', '', '', 'PALOP, Luanda, Taludes, LEA Angola, Timor, DG, NGUT'),
(7, 'QUALISTEELCOAT', 'Participação em reunião da  QUALISTEELCOAT realizada na Alemanha.', 'A reunião contou com a presença de todos os inspetores e técnicos responsáveis pelos ensaios no âmbito da Marca Qualisteelcoat.', '', 2015, '', 1, 'Pedro Filipe Galego', 'repos/2015/QUALISTEELCOAT/relatorios/mod583_rel_congressos_pgalego_V3.pdf', '', '', '', '', '', 'Qualisteelcoat, lacagem, pintura, revestimento'),
(8, 'CTaC', 'Participação na reunião da Comissão Técnica da Acreditação de Organismos de Certificação (CTaC).', 'A principal decisão resultante desta reunião, com interesse para o LNEC, foi que todos os organismos notificados são obrigados a usar o símbolo do IPAC nos certificados.  ', '', 2015, '', 1, 'Odete Fernandes', 'repos/2015/CTaC/relatorios/Rel_CTaCjan_2015_V3.pdf', '', '', '', '', '', 'CTaC, IPAC, certificação'),
(9, 'BV-Portugal', 'Participação na reunião do Comité de Certificação da Bureau Veritas Portugal ', 'Esta reunião do Comité de Certificação da Bureau Veritas realiza-se anualmente e a técnica signatária é representante \r\ndo LNEC neste Comité. ', '', 2015, '', 1, 'Odete Fernandes', 'repos/2015/BV-Portugal/relatorios/rel_missoes_BV_jan2015_V3.pdf', '', '', '', '', '', 'BV, Veritas, Certificação'),
(10, 'ISSMGE', 'Participação no   7 th   International  Congress  on  Environmental Geotechnics, ISSMGE, Melbourne, Australia. \r\nParticipou na Reunião Plenária do Technical Committee 215', 'A partcipação constou da apresentação oral  do trabalho &#34;Almeida,  R.P.M.  de,  Roque,  A.J.,  Silva,  A.P.F. da  (2014).  Study  of  the  hydraulic  behavior of  steel  slag  and  C&DW \r\nrecycled  aggregates  to  MSW  landfill  leachat', '', 2014, '', 1, 'António Roque', 'repos/2014/ISSMGE/relatorios/Inf_130_V2.pdf', '', '', '', '', '', 'ISSMGE,Geotechnics, Geotécnia,   RMIT, landfill '),
(11, 'SCANSCI', 'Participação em Seminário.', 'Apresentação  de  equipamentos  efetuada  pela  Scansci  –  Equipamentos  de  Laboratório,  Lda.,  nomeadamente  do microscópio de bancada “Tabletop Microscope TM3030Plus”. ', '', 2015, '', 1, 'Ana Paula Menezes', 'repos/2015/SCANSCI/relatorios/rel_costa_Caparica_scansci_V2.pdf', '', '', '', '', '', 'Microscope, TM3030Plus, '),
(12, 'COST-TU1402', 'Participação na  Ação  COST TU1402, intitulada “Quantifying the value of structural health monitoring”.', 'A missão realizada teve por objetivo participar na primeira reunião deste Comité, que teve lugar no passado dia 13 de novembro, em Bruxelas. ', '', 2015, '', 1, 'Luís Oliveira Santos', 'repos/2015/COST-TU1402/relatorios/204-11-Bruxelas_V2.pdf', '', '', '', '', '', 'COST, TU1402, structural, health, monitoring'),
(13, 'DTP-Constantine', 'Campanha de observação em Constantine, Argélia.', 'Esta campanha de observação teve como objetivos a formação de técnicos da DTP (Direction des Travaux Public) de Constantine, entidade que tutela esta obra de arte e a conclusão da instalação do sistema de monitorização.  ', '', 2015, '', 1, 'Luís Oliveira Santos', 'repos/2015/DTP-Constantine/relatorios/2014-10-Argelia_V3.pdf', '', '', '', '', '', 'DTP, monitorização, sensores, Constantine, Argélia'),
(14, 'CTTP-Argelia', 'Realização de missão a Argel para participação em reuniões.', 'Realização de missão a Argel tendo em vista a preparação do contrato do projeto de geminação Franco-Português de apoio ao Organismo Nacional de Controle Técnico das Obras Públicas (CTTP) da \r\nArgélia, no domínio do sistema de suporte à deci', '', 2015, '', 1, 'António Lemond de Macedo', 'repos/2015/CTTP-Argelia/relatorios/INF34_RelatorioMissaoArgel_fevereiro2015_V1.p', '', '', '', '', '', 'CTTP, Argel, UGP, UGP-3A'),
(15, 'YRS', 'Reunião  do  Steering  Committee  do  seminário  Young Researchers Seminar.', 'A presente missão destinou-se à participação do signatário na reunião do Steering Committee do seminário Young Researchers  Seminar  (YRS),  organizado  conjuntamente  pelo  FERSI,  FEHRL  e  ECTRI,  a  qual  teve  lugar  na Universidade de', '', 2014, '', 1, 'João Paulo Cardoso', 'repos/2014/YRS/relatorios/INF20_Rel_Missao_Roma_JLC_V2.pdf', '', '', '', '', '', 'YRS,  FERSI, FEHRL, ECTRI'),
(16, 'CEN-TC-250', 'Participação na 45ª reunião plenária da CEN/TC 250 Structural Eurocodes, realizada em Londres, nas instalações da BSI, nos dias 19 e 20 de maio de 2014.  ', 'Os assuntos tratados constam dos documentos  Doc. CEN/TC 250 N 1075,  Doc. CEN/TC 250 N 1157 e  Doc. CEN/TC 250 N 1125, que podem ser consultados na pasta &#34;docs&#34;.', '', 2014, '', 1, 'Manuel Pipa', 'repos/2014/CEN-TC-250/relatorios/Rel_missao_45_Londres_V2.pdf', '', '', '', '', '', 'CEN/TC, N1157, N1125, N1075,structural, geotechnical '),
(17, 'CEN-TC-250-R46', 'Participação na 46ª reunião plenária da CEN/TC 250 Structural Eurocodes, realizada em Viena, nas instalações da ASI, nos dias 20 e 21 de novembro de 2014.  ', 'Os assuntos tratados constam dos documentos  Doc. CEN/TC 250 N 1218 e  Doc. CEN/TC 250 N 1219, que podem ser consultados na pasta &#34;docs&#34;.', '', 2014, '', 1, 'Manuel Pipa', 'repos/2014/CEN-TC-250-R46/relatorios/Rel_missao_46_Viena_V2.pdf', '', '', '', '', '', 'CEN/TC-250, N1218, N1219, Structural, Eurocodes'),
(18, 'ANA-Brasil', ' Pariticpação de reuniões de trabalho no âmbito do contrato de\r\nInformação n.°; O\r\nAssistência Técnica à Agência Nacional de Águas (ANA) em Segurança de Barragens em Brasília.', 'Realizaram-se diversas reuniões de trabalho com a Agência Nacional de Águas (ANA) e o Banco Mundial, no âmbito\r\ndo contrato de Assistência Técnica à ANA em Segurança de Barragens em Brasilia. Foi feita a apresentação do\r\nsistema SNISB.', '', 2014, '', 1, 'Eliane Portela', 'repos/2014/ANA-Brasil/relatorios/Inf95_V1.pdf', '', '', '', '', '', 'Barragens, ANA, SNISB'),
(19, 'FRINGE-2015', 'Participação em Workshop &#34;Fringe 2015 Workshop: Advances in the Science and Applications of SAR Interferometry and Sentinel-1 InSAR&#34; em Frascati, Itália de 23 a 27 de março de 2015.', 'Temas principais: Satélite Sentinel-1A, programa Copernicus, iniciativas internacionais de disponibilização de imagens, exploração da coerência de imagens SAR, interferometria  SAR, mapeamento e aplicações da tecnologia à monitorização de infraestruturas, sismos, subsidência, deslizamentos de terra, criosfera e vulcões.', '', 2015, '', 1, 'Dora Roque', 'repos/2015/FRINGE-2015/relatorios/Inf_166_V1.pdf', '', '', '', '', '', 'Fringe, Sentinel-1A, SAR, InfraSAR, espacial, ESA, sismos, vulcões, criosfera, DBB, NGA'),
(20, 'RILEM-TC-RSC', 'Participação em Reunião do Comité da RILEM TC RSC - Recommendations for Use of Superabsorbent Polymers in Concrete Construction.', 'A reunião teve como objetivo definir os temas para os grupos de trabalho, bem como o seu âmbito de atuação e os respetivos líderes. ', '', 2015, '', 1, 'António Bettencourt Ribeiro ', 'repos/2015/RILEM-TC-RSC/relatorios/relatorio_CT_paris_marco_V2.pdf', '', '', '', '', '', 'RILEM-TC-RSC, NBPC, Polymers, concrete, WG2');
